var $bm_rt;
var xFreq, xSpeed, damping, wl, phaseOffset, theta;
xFreq = 0.5;
xSpeed = 150;
damping = 15;
wl = $bm_div(xSpeed, xFreq);
phaseOffset = $bm_mul($bm_mul($bm_div($bm_mod($bm_transform.position[0], wl), wl), 2), Math.PI);
theta = Math.atan(Math.cos($bm_sum($bm_mul($bm_mul($bm_mul(2, Math.PI), xFreq), time), phaseOffset)));
$bm_rt = $bm_div(radiansToDegrees(theta), damping);

