var $bm_rt;
var xAmp, xFreq, xSpeed, wl, phaseOffset, y;
xAmp = 5;
xFreq = 0.5;
xSpeed = 150;
wl = $bm_div(xSpeed, xFreq);
phaseOffset = $bm_mul($bm_mul($bm_div($bm_mod($bm_transform.position[0], wl), wl), 2), Math.PI);
y = $bm_mul(xAmp, Math.sin($bm_sum($bm_mul($bm_mul($bm_mul(2, Math.PI), xFreq), time), phaseOffset)));
$bm_rt = $bm_sum(value, [
    0,
    y
]);

